import React, {Component} from 'react'
import Search from "./Search.js"





class Header extends Component{
    render(){
        return(
            <div className="navbar  bg-danger rounded text-white ">

                <h2>ESS STORE</h2>
                <div><h5><em><Search /></em> </h5></div>
                <img src="/img" alt=''/>







            </div>
        )
    }
}

export default Header
